import React from 'react';
import { navStyle } from '../navStyle';
import Button from 'react-bootstrap/Button';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Form from 'react-bootstrap/Form';

class Navigation extends React.Component {

  render() {

    let { color, backgroundColor, brand } = navStyle;

    return (
        <Navbar style={{backgroundColor}} expand="lg" className="justify-content-lg-center">
            <Navbar.Brand style={brand} href="#home">Personal Capital</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav" style={{float: 'right'}}>
              <Nav>
                <Nav.Link style={{color}} href="/home">Financial Tools</Nav.Link>
                <Nav.Link style={{color}}>Wealth Management</Nav.Link>
                <Nav.Link style={{color}}>About</Nav.Link>
                <Nav.Link style={{color}}>Resources</Nav.Link>
                <Button href="#">Login</Button>
                <Button href="#">Sign Up</Button>
              </Nav>
            </Navbar.Collapse>
        </Navbar>
    )
  }
}

export default Navigation;
